# A [[bitter]] [[principle]] obtained from the [[berry|berries]] of the [[fly honeysuckle]] (''Lonicera xylosteum'') and formerly used in [[medicine]].
#* '''2008''', Alexander Campbell, Michael Chapman, ''Handbook of Poisoning in Dogs and Cats''
#*: Honeysuckle fruits contain valerianic acid and '''xylostein''', which are irritant.
